import React from 'react'
import {CoursesWrapper, ModuleWrapper, ModuleGrid, Course} from './CoursesElements'
import {Module1} from "./Data"


const CourseList = ({
    headline
}) => {


    return (
        <CoursesWrapper>
            <ModuleWrapper>
                <ModuleGrid>
                    <Course headline={headline}>
                    </Course>
                    <Course />
                </ModuleGrid>
            </ModuleWrapper>
        </CoursesWrapper>
    )
}

export default CourseList
